import styled from "styled-components";

export const Isprobaj = styled.nav`
  background: #0c0c0c;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 0 30px;
  height: 100vh;
  position: relative;
  z-index: 1;
  background: #010606;
`;

export const IsprobajContainer = styled.div`
  display: flex;
  flex-direction: row;
`;

export const IsprobajWrapper = styled.div``;

export const LoadingBarTitle = styled.h1`
  color: #fff;
`;
